<span class="token comment">// \u5148\u8C03\u7528valueOf\uFF0C\u8FD4\u56DE[]\uFF0C\u9700\u8981\u518D\u8C03\u7528toString\uFF0C\u8FD4\u56DE&#39;&#39;, \u8868\u8FBE\u5F0F\u53D8\u6210&#39;&#39; == false\uFF0C</span>
